import React, { Component } from 'react'

export default class HeaderComponent extends Component {
  render() {
    return (
      <div>
        <header>
          <div className="Search">
            <input
              type="text"
              placeholder="Search"
              value={searchTerm}
              onChange={handleChange}
            />
            <ul>
              <li>Item 1</li>
              <li>Item 2</li>
            </ul>
          </div>
        </header>
      </div>
    )
  }
}
